/*  API/getCourses.js
    Robin Marillia

    Recupere les todos depuis un site distant
*/

function getTodos(callback){

    fetch("http://www.mocky.io/v2/5ebab22a3600006100f7e279").then(function(response) {
        return response.text()
      }).then(function (text) {
            //var json = JSON.parse(text)
            console.log(text.text())
      })
}

export default getTodos
